import React, { Component } from "react";

class Quiz extends Component {
  render() {
    return (
      <div>
        <h2>Pyetja 1</h2>
        <div>
          <p>Lumi eshte me i madh se perrocka?</p>
          <div>
            <button>Sakte</button>
            <button>Pasakte</button>
          </div>
        </div>
      </div>
    );
  }
}

export default Quiz;
